<area shape="rect" id="node3_68" href="../../ag_codes/CLUIDSimpleType/index.html#diagram" title="A data type for system-generated internal identifier of a common land unit (CLU). This identifier is for internal access use only.   A CLU is the smallest unit of land that has a permanent, contiguous boundary, common land cover and land management, a common owner, and a common producer association.   A CLU is closely related to FSA's definition of 'fields', according to Handbook 2-CP. A CLU is also closely related to land units such as parcels, farmsteads, and lots that are used by NRCS, RMA and RD.   The authoritative source of CLU Identifier is Farm Records. CLU Identifier can remain constant even if the precise geospatial shape of the CLU is slightly altered." alt="" coords="437,104,907,121"/>
